# Parse HTML
soup = BeautifulSoup(html, "html.parser")
rows = []

# Extract data
for li in soup.select("ul.history-table-container > li"):
    spans = li.find_all("span")
    if len(spans) == 6:
        date, product, game, stake, valid_bet, result = [span.text.strip() for span in spans]
        rows.append([date, product, game, stake, valid_bet, result])

# Sort rows by datetime
rows.sort(key=lambda row: datetime.strptime(row[0], "%Y-%m-%d %H:%M:%S"))

# Save to CSV
csv_filename = "slot_history.csv"
with open(csv_filename, "w", newline="", encoding="utf-8") as f:
    writer = csv.writer(f)
    writer.writerow(["Date", "Product", "Game", "Stake", "Valid Bet", "Win/Loss"])
    writer.writerows(rows)

print(f"✅ CSV file saved as: {csv_filename}")
